import React from 'react';

import './errors.scss';

class Errors extends React.Component {
  constructor(props) {
    super(props);
    this.state = {};
  }

  componentWillUnmount() {
      this.props.history.push(`/`);
  }

  render() {
    return (
      <div className="index">
        <div className="errors">
          <img id="study-img" src="https://stockhome-app-seeds.s3-us-west-1.amazonaws.com/study_dog.png"></img>
          <div>Oops, something went wrong on our end :( </div>
          <br />
          <div id="yellow">Try again in a few moments and we'll be back up</div>
        </div>
      </div>
    );
  }
}




export default Errors;
